import React from "react";
import {
    Box,
    Icon,
    Button,
    Fab,
    styled,
    TablePagination,
    Table,
    TableBody,
    TableCell,
    TableHead,
    TableRow,
} from "@mui/material";
import { SimpleCard } from "app/components";
import { useState, useEffect, useParams } from "react";
import { Link, Navigate } from "react-router-dom";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogTitle from "@mui/material/DialogTitle";
import Slide from "@mui/material/Slide";
import { toast } from "react-toastify";
import { getquetionList } from "app/apis/apiMethods";
import FormControlLabel from "@mui/material/FormControlLabel";
import FormLabel from "@mui/material/FormLabel";
import Radio from "@mui/material/Radio";


const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
});

const Container = styled("div")(({ theme }) => ({
    margin: "30px",
    [theme.breakpoints.down("sm")]: { margin: "16px" },
    "& .breadcrumb": {
        marginBottom: "30px",
        [theme.breakpoints.down("sm")]: { marginBottom: "16px" },
    },
}));

const StyledTable = styled(Table)(({ theme }) => ({
    whiteSpace: "pre",
    "& thead": {
        "& tr": { "& th": { paddingLeft: 0, paddingRight: 0 } },
    },
    "& tbody": {
        "& tr": { "& td": { paddingLeft: 0, textTransform: "capitalize" } },
    },
}));

const StyledButton = styled(Button)(({ theme }) => ({
    margin: theme.spacing(1),
}));

export default function QuestionList() {
    const [state, setState] = useState([]);
    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(1);
    const [open, setOpen] = React.useState(false);
    const [userID, setUserID] = useState("");

    var { id } = useParams();

    function handleClickOpen(id) {
        setOpen(true);
        setUserID(id);
    }
    function handleClose() {
        setOpen(false);
    }

    // const getUser = async()=>{
    //     const users= await getUser(id);
    //     console.log('users.data.data')
    //     setState(users.data)
    // }

    const questionList = async () => {
        const users = await getquetionList();
        console.log('users.data.data', users);
        // useEffect=(()=>{
            //     var data = JSON.parse(localStorage.getItem('user'))
            //     console.log(data) 
            // })
        setState(users.data);
    };

    useEffect(() => {
        console.log(id)
        questionList();
    }, []);

    // const filterQuestionList= filterQuestionList.filter(question => {    
    //     if (searchQuestionlist.length > 0) {                 
    //       return filterQuestion.some(question=> question.id === exam.id) 
    //     } else {
    //       return question
    //     }
    //   })

    //   const question = filterQuestionList.map(question=> {
    //     return (
    //         <question
    //             key={question.id} 
    //             question={question}
    //             exam ={exam}
    //             onAddExam={handleAllExam}
    //         />
    //     )
    //   })

    const handleChangePage = (_, newPage) => {
        setPage(newPage);
      };

      const handleChangeRowsPerPage = (event) => {
        setRowsPerPage(+event.target.value);
        setPage(0);
      };

    return (
        <Container>
            <Box width="100%" overflow="auto">
                <SimpleCard>
                    <StyledTable>
                        <TableHead>
                            <TableRow>
                                <TableCell align="center" >S.No</TableCell>
                                <TableCell align="center">title</TableCell>
                                <TableCell aligen="center">Options</TableCell>
                                <TableCell align="center">Action</TableCell>
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {/* {state && state */}
                            {state && Array.isArray(state) && state.length > 0 && state
                             .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                                .map((item, index) => {
                                    console.log('item, index', item, index);
                                    return (
                                        <TableRow key={index}>
                                            <TableCell align="center">{index + 1}</TableCell>
                                            <TableCell align="center" variant="contained" color="primary" >
                                                {item.title}
                                            </TableCell>
                                            <TableCell>

                                                {item.questionType == 'Radio' && item?.options.map((item, mykey) => {
                                                    return (
                                                        <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="radio" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                        </>
                                                    )
                                                })}
                                                {item.questionType == 'Checkbox' && item?.options.map((item, mykey) => {
                                                    return (
                                                        <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="Checkbox" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                        </>
                                                    )
                                                })}
                                                {item.questionType == 'Bool' && item?.options.map((item, mykey) => {
                                                    return (
                                                        <>
                                                            <TableRow key={mykey}><TableCell align="right" ><input type="radio" id={`coustomradio${index}`} name={`coustomradio${index}`} /> {item.text}</TableCell></TableRow>
                                                        </>
                                                    )
                                                })}
                                            </TableCell>
                                            <TableCell align="center">
                                                <StyledButton variant="contained" color="primary" >
                                                    answer
                                                </StyledButton>
                                            </TableCell>
                                        </TableRow>
                                    )
                                })}

                            <Dialog
                                open={open}
                                keepMounted
                                onClose={handleClose}
                                TransitionComponent={Transition}
                                aria-labelledby="alert-dialog-slide-title"
                                aria-describedby="alert-dialog-slide-description"
                            ><DialogActions>
                                    <Button onClick={handleClose} color="primary">
                                        <h6>No</h6>
                                    </Button>

                                </DialogActions>
                            </Dialog>
                        </TableBody>
                    </StyledTable>
                </SimpleCard>
                <TablePagination
                    sx={{ px: 2 }}
                    page={page}
                    component="div"
                    rowsPerPage={rowsPerPage}
                    count={state.length}
                    onPageChange={handleChangePage}
                    rowsPerPageOptions={[1,5]}
                    onRowsPerPageChange={handleChangeRowsPerPage}
                    nextIconButtonProps={{ "aria-label": "Next Page" }}
                    backIconButtonProps={{ "aria-label": "Previous Page" }}
                />

            </Box>
        </Container>
    );
}
